                myChart.data.datasets[0].data = parsedData.map(d => ({x: d.x, y: d.long}));
                myChart.data.datasets[1].data = parsedData.map(d => ({x: d.x, y: d.short}));
                myChart.update('none'); // 'none' mode prevents full animation flicker
                return;
